package com.datametica.tests;

import java.util.ArrayList;
import java.util.List;

public class SubStringCountMatchAndMiddleDifferentTest {
  public static void main(String[] args) {
    SubStringCountMatchAndMiddleDifferentTest test = new SubStringCountMatchAndMiddleDifferentTest();
    System.out.println(test.substrCount(4, "idfbidecgjjfdfiffhjeeegdbbdfbhfikkdfdfkihikdkhhgefdkcbdigfkiggkgedckicfbdeccdgdjid" +
      "" +
      "kfcbciikjhhgjfjheecgechkkjjkghcbkjjbhidjbicjhbbieigjkhekhcbekkkcgghgcffkikgkeikgfgigcbggjhgciifdjebc"));
  }

  // Complete the substrCount function below.
  static long substrCount(int n, String input) {
    List<String> result = new ArrayList<>();
    if (!isEmpty(input)) {
      for (int index = 0; index <= input.length(); index++) {
        for (int i = index; i <= input.length(); i++) {
          String temp = input.substring(index, i);
          if (valid(temp)) {
            result.add(temp);
          }
        }
      }
    }
    return result.size();

  }


  private static boolean isEmpty(String input) {
    return input == null || input.trim().isEmpty();
  }

  private static boolean valid(String input) {
    if (isEmpty(input))
      return false;
    else {
      if (input.length() % 2 == 0) {
        return isAllCharsSame(input);
      } else {
        String firstString = input.substring(0, input.length() / 2);
        String secondString = input.substring(input.length() / 2 + 1);
        return isAllCharsSame(input) || (isAllCharsSame(firstString) && isAllCharsSame(secondString) && firstString.equals(secondString));
      }
    }
  }

  private static boolean isAllCharsSame(String input) {
    ArrayList arrayList = new ArrayList();
    for (Character c : input.toCharArray()) {
      arrayList.add(c);
    }
    return arrayList.stream().allMatch(item -> item.equals(input.charAt(0)));
  }
}